script: |
  super -f text -I q13656.spq | sort > q13656.out

inputs:
  - name: q13656.spq
    data: |
      SELECT - col0 AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE col0 + + + col0 NOT IN ( col2 * + + col0 * col1 );
  - name: tab1

outputs:
  - name: q13656.out
    data: |
      -51
      -85
      -91
